import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import PatientForm from './components/PatientForm'; // Import PatientForm component
import DoctorForm from './components/DoctorForm'; // Import DoctorForm component

const App = () => {
  const [showForm, setShowForm] = useState(false);

  const toggleForm = () => {
    setShowForm(!showForm);
  };

  return (
    <Router>
      <div>
        {/* Button to toggle form visibility */}
        <button onClick={toggleForm}>
          {showForm ? 'Hide Form' : 'Show Form'}
        </button>

        {/* Conditionally render routes based on showForm state */}
        {showForm && (
          <Routes>
            <Route path="/patient-form" element={<PatientForm />} />
            <Route path="/doctor-form" element={<DoctorForm />} />
          </Routes>
        )}

        {/* Navigation links to different forms */}
        <nav>
          <ul>
            <li>
              <Link to="/patient-form">Patient Form</Link>
            </li>
            <li>
              <Link to="/doctor-form">Doctor Form</Link>
            </li>
          </ul>
        </nav>
      </div>
    </Router>
  );
};

export default App;
